let groupRandom = function(arr) {

    let shuffle = function(arr) {
        for(let i = arr.length - 1; i > 0; i--) {
            let j = Math.floor(Math.random() * (i + 1));
            [arr[i], arr[j]] = [arr[j], arr[i]];
        }
        return arr;
    }


    let regroup = function(arr) {
        let newArr = [], temp = [];
        for(let i = 0; i < arr.length; i++) {
            temp.push(arr[i]);
            if(temp.length === 2) newArr.push(temp), temp = [];
        }
        return newArr;
    }


    let arrSuffeled = shuffle(arr);
    let arrRegrouped = regroup(arrSuffeled);
    return arrRegrouped;
};

